// src/components/Auth/Register.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '../../services/api';

const Register = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password1: '',
    password2: '',
    first_name: '',
    last_name: ''
  });

  const [errors, setErrors] = useState({});
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await api.post('auth/registration/', formData);
      alert('Registration successful! Please log in.');
      navigate('/login');
    } catch (error) {
      if (error.response && error.response.data) {
        setErrors(error.response.data);
      } else {
        setErrors({ non_field_errors: ['Registration failed. Please try again.'] });
      }
    }
  };

  return (
    <div style={{
      minHeight: '100vh',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: '#e6e6e6',
      padding: '20px'
    }}>
      <form onSubmit={handleSubmit} style={{
        width: '100%',
        maxWidth: '400px',
        backgroundColor: '#f5f5f5',
        padding: '30px',
        borderRadius: '10px',
        boxShadow: '0 4px 12px rgba(0,0,0,0.1)'
      }}>
        <h2 style={{ textAlign: 'center', marginBottom: '20px' }}>Register</h2>

        {errors.non_field_errors && (
          <div style={{ color: 'red', marginBottom: '15px' }}>
            {errors.non_field_errors.map((error, i) => <p key={i}>{error}</p>)}
          </div>
        )}

        <input type="text" name="first_name" placeholder="First Name"
          value={formData.first_name} onChange={handleChange} style={inputStyle} />
        {errors.first_name && <p style={errorStyle}>{errors.first_name}</p>}

        <input type="text" name="last_name" placeholder="Last Name"
          value={formData.last_name} onChange={handleChange} style={inputStyle} />
        {errors.last_name && <p style={errorStyle}>{errors.last_name}</p>}

        <input type="text" name="username" placeholder="Username"
          value={formData.username} onChange={handleChange} required style={inputStyle} />
        {errors.username && <p style={errorStyle}>{errors.username}</p>}

        <input type="email" name="email" placeholder="Email"
          value={formData.email} onChange={handleChange} required style={inputStyle} />
        {errors.email && <p style={errorStyle}>{errors.email}</p>}

        <input type="password" name="password1" placeholder="Password"
          value={formData.password1} onChange={handleChange} required style={inputStyle} />
        {errors.password1 && <p style={errorStyle}>{errors.password1}</p>}

        <input type="password" name="password2" placeholder="Confirm Password"
          value={formData.password2} onChange={handleChange} required style={inputStyle} />
        {errors.password2 && <p style={errorStyle}>{errors.password2}</p>}

        <button type="submit" style={buttonStyle}>Register</button>
      </form>
    </div>
  );
};

const inputStyle = {
  width: '100%',
  padding: '12px 15px',
  marginBottom: '10px',
  borderRadius: '5px',
  border: '1px solid #ccc',
  fontSize: '14px',
  backgroundColor: '#ffffff'
};

const buttonStyle = {
  width: '100%',
  padding: '12px',
  border: 'none',
  borderRadius: '5px',
  backgroundColor: '#333',
  color: '#fff',
  fontSize: '16px',
  cursor: 'pointer',
  marginTop: '10px'
};

const errorStyle = {
  color: 'red',
  marginBottom: '8px',
  fontSize: '13px'
};

export default Register;
